import { withRouter } from 'react-router-dom';
class SearchNote extends Component {
    constructor(props){
super(props)
this.state={
    hello : hello
}
    }
    render() {
        {this.state.hello}
        return (
            <div>
                {this.props.open ? <div> hey </div> : ''}

            </div>
        )
    }
}
export default  withRouter(SearchNote)
